import { useState } from "react";
import "./App.css";
import DashBoard from "./Pages/MyAccount/DashBoard";
import Home from "./Pages/Home";
import Vehicles from "./Pages/Vehicles";
import MyAccount from "./Pages/MyAccount";
import ContactUs from "./Pages/ContactUs";
import ProductDetals from "./Pages/ProductD";
import Faqs from "./Pages/Faqs";
import AboutUs from "./Pages/AboutUs";
import Error from "./Pages/Error";
import SignUp from "./Pages/MyAccount/SignUp";
import SignIn from "./Pages/MyAccount/SignIn";
import HeaderSection from "./Components/HeaderSection/HeaderSection";
import Footer from "./Components/Home/Footer";
import {
  BrowserRouter,
  Routes,
  Route,
  Navigate,
} from "react-router-dom";
import NewBid from "./Components/NewBid/NewBid";

function App() {
  return (
    <BrowserRouter className="App">
      <Routes>
       <Route exact path="/" element={<Home/>}/>
       <Route path="/DashBoard" element={<DashBoard/>}/>
       <Route path="/MyAccount" element={<MyAccount/>}/>
       <Route path="/ContactUs" element={<ContactUs/>}/>
       <Route path="/ProductDetals" element={<ProductDetals/>}/>
       <Route path="/Faqs" element={<Faqs/>}/>
       <Route path="/AboutUs" element={<AboutUs/>}/>
       <Route path="/Error" element={<Error/>}/>
       <Route path="/SignUp" element={<SignUp/>}/>
       <Route path="/SignIn" element={<SignIn/>}/>
       <Route path="/Footer" element={<Footer/>}/>
       <Route path="/MyAccount" element={<MyAccount/>}/>
       <Route path="/create-bid" element={<NewBid/>}/>
      {/* <App2/> */}
      {/* <Home /> */}
      {/* <Vehicles/> */}
      {/* <DashBoard/> */}
      {/* <MyAccount/> */}
      {/* <ContactUs/> */}
      {/* <ProductDetails /> */}
      {/* <ProductDetals/> */}
      {/* <Faqs/> */}
      {/* <AboutUs/> */}
      {/* <Error /> */}
      {/* <SignUp /> */}
      {/* <SignIn/> */}
      {/* <Footer/> */}
      </Routes>
    </BrowserRouter>
  );
}

export default App;
